import React, { useState, useEffect } from 'react';
import { Table, Button } from 'react-bootstrap';
import {Layout, StyledInput, BodyLayout } from "./style";
import { Navigate, useNavigate } from 'react-router-dom';
import api from '../../services/api';
import moment from 'moment';

interface IUsers{

  id: number;
  placa: string;
  name: string;
  status: string;
  data: string;   
  modelo: string;
  pagamento: string;

}

const View: React.FC = () => {

  const [users, setUsers] = useState<IUsers[]>([])
  const navigate = useNavigate()

  useEffect(() => {
      loadUsers()

}, [])

async function loadUsers() {
  const response = await api.get('/users')
  console.log(response);
  setUsers(response.data)

}

function formatDate(date: Date){
  return moment(date).format('DD/MM/YYYY')
}


function viewTask(){
  navigate("/users")
}


  return (
    <>
    <BodyLayout>
        <Layout>
    <div className="container">
        <br />
        <div className="user-header">
        <h1>Visualizar Usuários</h1>
            <Button size="sm" variant="btn btn-outline-success" onClick= { viewTask } >Editar usuários</Button>

    </div>
        <br />
        <Table striped bordered hover className="text-center">
            <thead>
                <tr>
                <th>id</th>
                <th>Nº DA PLACA</th>
                <th>NOME</th>             
                <th>STATUS</th>
                <th>DATA</th>
                <th>MODELO</th>
                <th>PAGAMENTO</th>
                </tr>
            </thead>
            <tbody>
                {
                    users.map(user => (
                    <tr key={user.id}>
                    <td>{user.id}</td>
                    <td>{user.placa}</td>
                    <td>{user.name}</td> 
                    <td>{user.status}</td>                
                    <td>{user.data}</td>
                    <td>{user.modelo}</td>
                    <td>{user.pagamento}</td>
                    </tr>
                ))
            }
        </tbody>
        </Table>
    </div>
        </Layout>
    </BodyLayout>
    </>
    );
}
export default View;
